import React, { useState, useEffect } from "react";
import { Table } from "antd";
import { API_URL } from '../utils/constants';

function FileList() {
  const [files, setFiles] = useState([]);

  useEffect(() => {
    fetch(`${API_URL}/getAllFiles`)
      .then(response => response.json())
      .then(data => setFiles(data));
  }, []);

  const columns = [
    {
      title: "Title",
      dataIndex: "title",
      key: "title"
    },
    {
      title: "Description",
      dataIndex: "description",
      key: "description"
    },
    {
      title: "Model",
      dataIndex: "model",
      key: "model"
    },
    {
      title: "File Path",
      dataIndex: "file_path",
      key: "file_path"
    },
    {
      title: "Timestamp",
      dataIndex: "timestamp",
      key: "timestamp"
    }
  ];

  return (
    <Table dataSource={files} columns={columns} rowKey="title" />
  );
}

export default FileList;
